             <header className=" bg-black w-48 text-white" style={{height:"100vh" }}>
                    <nav>
                        <li><Link to="/Courses"  style={({ isActive }) => ({
    color: isActive ? '#fff' : '#545e6f',
    background: isActive ? '#7600dc' : '#f0f0f0',
  })} > sdsd</Link></li>
                        <li><Link></Link></li>
                        <li><Link></Link></li>
                    </nav>
             </header>
        </Link>

        </div>
    )
}

export default Navbar;
